import React from "react";

function Popup(props) {
  return props.trigger ? (
    <div className="fixed top-0 left-0 flex items-center justify-center w-auto h-auto bg-gray-100">
      <div className="relative w-auto max-w-6xl p-32 bg-gray-50">
        <button className="absolute w-auto max-w-6xl p-32 bg-gray-50 top-6 right-6">
          close
        </button>
        {props.children}
      </div>
    </div>
  ) : (
    ""
  );
}

export default Popup;
